        "privacyPolicy": MessageLookupByLibrary.simpleMessage("Dasar privasi"),
        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "Di bawah undang-undang Vietnam, maklumat pengguna seperti nama, alamat e-mel, kata laluan dan tarikh lahir boleh diklasifikasikan sebagai â€œmaklumat peribadi.\n\n khususnya,\n (a) Di bawah Dekri 72/2013, maklumat peribadi ditakrifkan sebagai maklumat yang dilampirkan pada pengenalan identiti dan butiran peribadi seseorang individu termasuk nama, umur, alamat, nombor kad pengenalan orang, nombor telefon, alamat e-mel dan maklumat lain. sebagaimana yang ditetapkan oleh undang-undang\n\n (b) Di bawah Pekeliling 25/2010, maklumat peribadi bermaksud maklumat yang mencukupi untuk mengenal pasti individu dengan tepat, yang merangkumi sekurang-kurangnya satu daripada butiran berikut: nama penuh, tarikh lahir, pekerjaan, gelaran, alamat hubungan, alamat e-mel, nombor telefon, identiti nombor kad dan nombor pasport. Maklumat privasi peribadi termasuk rekod kesihatan, rekod pembayaran cukai, nombor kad insurans sosial, nombor kad kredit dan rahsia peribadi lain.\n\n Pekeliling 25 terpakai kepada pengumpulan dan penggunaan maklumat peribadi oleh tapak web yang dikendalikan oleh pihak berkuasa Kerajaan Vietnam. Pekeliling 25 tidak terpakai secara langsung untuk pengumpulan dan penggunaan maklumat peribadi oleh tapak web yang dikendalikan oleh entiti bukan Kerajaan. Walau bagaimanapun, peruntukan Pekeliling 25 boleh digunakan secara analogi. Selain itu, berkemungkinan entiti bukan Kerajaan akan tertakluk kepada piawaian yang sama atau lebih ketat daripada piawaian yang terpakai kepada entiti Kerajaan."),
